import React from "react";

import "./Credential.css";

export default function Credential({ credential, key, removeAction }) {
  return (
    <p key={key}>
      {credential.username}: {credential.password}{" "}
      <button onClick={removeAction}>Remove</button>
    </p>
  );
}
